import React from "react";
import NavBar from "./navbar";
import { Slide } from "react-slideshow-image";
import "react-slideshow-image/dist/styles.css";
class HomePage extends React.Component {
  render() {
    return (
      <div>
        <NavBar color="white" active="login" />
        <div className="bg-blue-00 h-screen">
          <Slide>
            <div className="bg-image-1 h-screen w-screen z-0 bg-center flex items-center">
              <div className="text-white flex flex-col px-2 max-w-sm bg-red-500">
                <span className="font-bold uppercase text-4xl">
                  WE BUILD SOLUTION AND SELL QUALITY PRODUCT
                </span>
                <span className="text-lg my-5">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  Auctor ac tristique pellentesque sagittis aliquet nunc. In
                  cursus erat odio arcu, ornare. Sed risus et.
                </span>
                <button className="bg-yellow-500 w-2/3 py-2 rounded-md">
                  GET STARTED
                </button>
              </div>
            </div>
          </Slide>
        </div>
      </div>
    );
  }
}

export default HomePage;
